    display: flex;
  }
}

.social-logo-svg {
  width: 24px;
  height: 24px;
  fill: var(--outline);
  transition: all 0.2s;
}

.social-logo-svg:hover {
  fill: var(--light);
  transform: scale(1.1);
  transform-origin: 50% 50%;
}

